import React from "react";

function Work() {
    return (
        <div className="about">
            <div className="container">
                <div className="row align-items-center my-4">
                    <div className="col-lg-6">
                        <img
                            className="img-fluid rounded mb-4 mb-lg-0"
                            src="https://proqvis-solutions.com/wp-content/uploads/2016/02/20140311_IMG_4321_900x400.png"
                            alt=""
                        />
                    </div>
                </div>

            </div>
        </div>
    );
}

export default Work;
